    onDefineAllowedActions(selection, projectFolderPath, credentials) {
        // console.log('--------------- allow credent ---------------', credentials);
        let previewAllowed = false;
        let exportAllowed = false;
        let shareAllowed = false;
        let exportOptionResult = false;
        let notAllowedReason = {
            preview: '',
            export: '',
            share: ''
        };
        let exprt = Object.assign({}, this.state.export);
        let exportOptions = exprt;
        if (!credentials) {
            if (exportOptions) {
                Object.keys(exportOptions).forEach(index => {
                    exportOptions[index] = false;
                });
            }
            exportOptions.html = this.state.export.html;
            exportOptions.css = this.state.export.css;
        }
        // console.log('--------------- EXPORT OPT ---------------', this.state.export);
        // console.log('--------------- EXPRT ---------------', exprt);
        // console.log('--------------- exportOptions ---------------', exportOptions);
        // NOTE Regras para habilitar os botões de ações.
        if (selection.items[0] && selection.items[0].parent && selection.focusedArtboard && (selection.items[0].parent.guid === selection.focusedArtboard.guid || selection.items[0].guid === selection.focusedArtboard.guid)) {
            if (exportOptions) {
                exportOptionResult = exportOptions.html || exportOptions.css || exportOptions.react || exportOptions.litElement || exportOptions.reactNative;
                if (exportOptionResult) {
                    if (selection.focusedArtboard && selection.focusedArtboard.children && selection.focusedArtboard.children.length > 0) {
                        let socket = _conn.getSocket();
                        if (socket && socket.protocol) {
                            previewAllowed = true;
                        } else {
                            notAllowedReason.preview = this._LIVE_PREVIEW_NOT_CONNECTED;
                        }
                        if (credentials) {
                            // shareAllowed = true;
                        }
                        if (projectFolderPath && projectFolderPath !== '') {
                            exportAllowed = true;
                        } else {
                            notAllowedReason.export = this._FOLDER_PATH_NOT_SELECTED;
                        }
                    } else {
                        notAllowedReason.preview = this._NO_CHILDREN_ON_ARTBOARD;
                        notAllowedReason.export = this._NO_CHILDREN_ON_ARTBOARD;
                        notAllowedReason.share = this._NO_CHILDREN_ON_ARTBOARD;
                    }
                } else {
                    notAllowedReason.preview = this._CODE_FORMAT_NOT_SELECTED;
                    notAllowedReason.export = this._CODE_FORMAT_NOT_SELECTED;
                    notAllowedReason.share = this._CODE_FORMAT_NOT_SELECTED;
                }
            } else {
                notAllowedReason.preview = this._CODE_FORMAT_NOT_SELECTED;
                notAllowedReason.export = this._CODE_FORMAT_NOT_SELECTED;
                notAllowedReason.share = this._CODE_FORMAT_NOT_SELECTED;
            }
        } else {
            notAllowedReason.preview = this._SELECTION_OUTSIDE_ARTBOARD_EDIT_CONTEXT;
            notAllowedReason.export = this._SELECTION_OUTSIDE_ARTBOARD_EDIT_CONTEXT;
            notAllowedReason.share = this._SELECTION_OUTSIDE_ARTBOARD_EDIT_CONTEXT;
        }
        return {
            previewAllowed: previewAllowed,
            exportAllowed: exportAllowed,
            shareAllowed: shareAllowed,
            notAllowedReason: notAllowedReason,
            export: exportOptions
        };
    }

