    async onSelectFontPath(instanceName) {
        let fontFile;
        await _storage.getFileReference().then(selectedFile => {
            // console.log('--------------- ON SELECT PROJECT FOLDER ---------------', selectedFile);
            fontFile = selectedFile;
        }).catch(() => {
            // console.log('--------------- ON SELECT PROJECT FOLDER ERROR ---------------', err);
        });
        if (fontFile && fontFile.nativePath) {
            let usedFonts = this.state.usedFonts;
            let focusedArtboardFonts = this.state.focusedArtboardFonts;
            let focusedArtboardMissingFonts = [];
            Object.keys(usedFonts).forEach(index => {
                if (usedFonts[index].instanceName === instanceName) {
                    // let fileName = `${_utils
                    //     .stripChar(
                    //         _utils.getCleanName(fontFile.name.split('.')[0])
                    //     )
                    //     .toLowerCase()}.${fontFile.name.split('.')[1]}`
                    // usedFonts[index].fileName = fileName
                    usedFonts[index].fileName = fontFile.name;
                    usedFonts[index].path = fontFile.nativePath;
                    usedFonts[index].file = fontFile;
                }
            });
            Object.keys(focusedArtboardFonts).forEach(index => {
                if (focusedArtboardFonts[index].instanceName === instanceName) {
                    // let fileName = `${_utils
                    //     .stripChar(
                    //         _utils.getCleanName(fontFile.name.split('.')[0])
                    //     )
                    //     .toLowerCase()}.${fontFile.name.split('.')[1]}`
                    // focusedArtboardFonts[index].fileName = fileName
                    focusedArtboardFonts[index].fileName = fontFile.name;
                    focusedArtboardFonts[index].path = fontFile.nativePath;
                    focusedArtboardFonts[index].file = fontFile;
                }
            });
            Object.keys(focusedArtboardFonts).forEach(index => {
                if (!focusedArtboardFonts[index].file) {
                    focusedArtboardMissingFonts.push(focusedArtboardFonts[index]);
                }
            });
            // console.log('--------------- aqui ---------------', usedFonts);
            this.setState({
                usedFonts: usedFonts,
                focusedArtboardFonts: focusedArtboardFonts,
                focusedArtboardMissingFonts: focusedArtboardMissingFonts
            });
        }
    }

