    async onPreview() {
        // ANCHOR onPreview
        // console.log('--------------- ON PREVIEW ---------------');
        let allowedActions = this.onDefineAllowedActions(this.state.selection, this.state.projectFolder, this.state.credentials);
        let previewAllowed = allowedActions.previewAllowed;
        let notAllowedReason = allowedActions.notAllowedReason;
        // console.log('--------------- protocol ---------------', socket.protocol, this.state.previewAllowed, this.state.notAllowedReason);
        if (previewAllowed) {
            this.setState({
                working: true,
                previewAllowed,
                notAllowedReason,
                allowedActions,
                export: allowedActions.export
            }, () => {
                this.onImport('preview').then(() => {}).catch(() => {});
            });
        } else {
            // console.log('--------------- not protocol ---------------', this.state.previewAllowed, this.state.notAllowedReason);
            if (notAllowedReason.preview === this._LIVE_PREVIEW_NOT_CONNECTED) {
                this.props.onPreview('error', 'Preview error', React.createElement(
                    'p',
                    null,
                    'Unable to perform preview action. You must start the Fireblade Live Preview app.'
                ), 'https://fireblade.io', 'Download the Fireblade Live Preview app.');
                _conn.openWSConn(() => {
                    if (notAllowedReason.preview === this._LIVE_PREVIEW_NOT_CONNECTED) {
                        this.setState({
                            previewAllowed: true
                        }, () => {
                            this.props.onInform('success', 'Fireblade Live Preview is ON', React.createElement(
                                'p',
                                null,
                                'Nice! You can now use the preview action.'
                            ));
                        });
                    }
                });
            } else if (this.state.focusedArtboard && this.state.focusedArtboard.children && this.state.focusedArtboard.children.length > 0) {
                if (notAllowedReason.preview === this._CODE_FORMAT_NOT_SELECTED) {
                    this.props.onInform('error', 'Preview error', React.createElement(
                        'p',
                        null,
                        'Unable to perform preview action. You must select one or more code formats to export content. You can do this in the setup panel.'
                    ));
                } else if (notAllowedReason.preview === this._SELECTION_OUTSIDE_ARTBOARD_EDIT_CONTEXT) {
                    this.props.onInform('error', 'Preview error', React.createElement(
                        'p',
                        null,
                        'Unable to perform preview action. You must select an artboard or some element within the artboard editing context.'
                    ));
                }
            } else {
                this.props.onInform('error', 'Preview error', React.createElement(
                    'p',
                    null,
                    'Unable to perform preview action. You must have something drawn on your artboard.'
                ));
            }
        }
        // editDocument(async (selection, rootNode) => {
        //     let currentSelection = selection.items[0];
        //     selection.items = [currentSelection];
        // });
    }
