    async onSetup() {
        let setup;
        if (dialog) {
            dialog.close('ok');
        }
        dialog = document.createElement('dialog');

        ReactDOM.render(React.createElement(DialogSetup, {
            'export': this.export,
            features: this.features,
            credentials: this.credentials,
            path: this.projectFolderPath,
            onExportChange: this.onExportChange.bind(this),
            onFeatureChange: this.onFeatureChange.bind(this),
            onSelectPath: this.onSelectPath.bind(this),
            onCloseClick: () => {
                dialog.close('ok');
            }
        }), dialog);
        document.body.appendChild(dialog);
        await dialog.showModal().then(() => {
            // handle dialog result if canceled by ESC, will be "reasonCanceled" dialog =
            setup = {};
            setup.export = this.export;
            setup.features = this.features;
            setup.projectFolder = this.projectFolder;
            if (this.projectFolder) {
                setup.projectFolderPath = this.projectFolder.nativePath;
            }
            setup.bindable = this.bindable;
            setup.credentials = this.credentials;
        });
        if (setup) {
            return setup;
        } else {
            throw new Error('Error on setup panel.');
        }
    }

