    async onCreateProp(name, value, type, done) {
        // console.log(
        //     '--------------- ON CREATE PROP ---------------',
        //     name,
        //     value,
        //     type
        // )
        editDocument(async (selection, rootNode) => {
            if (selection.focusedArtboard) {
                _utils.transferElementPluginDataToRoot(selection, rootNode);
                // console.log('--------------- PANEL CONTROLLER - ON CREATE PROP - APÓS TRANSFIR ---------------');
                this.customProps.push({
                    name: name,
                    value: value,
                    type: type
                });
                let pData;
                if (rootNode.pluginData && rootNode.pluginData !== '') {
                    pData = JSON.parse(rootNode.pluginData);
                    if (pData[selection.focusedArtboard.guid]) {
                        pData[selection.focusedArtboard.guid].customProps = this.customProps;
                    } else {
                        pData[selection.focusedArtboard.guid] = {
                            customProps: this.customProps
                        };
                    }
                    rootNode.pluginData = JSON.stringify(pData);
                } else {
                    pData = {};
                    if (pData[selection.focusedArtboard.guid]) {
                        pData[selection.focusedArtboard.guid].customProps = this.customProps;
                    } else {
                        pData[selection.focusedArtboard.guid] = {
                            customProps: this.customProps
                        };
                    }
                    rootNode.pluginData = JSON.stringify(pData);
                }
                done(this.customProps);
                // if (selection.focusedArtboard.pluginData && selection.focusedArtboard.pluginData !== '') {
                //   pData = JSON.parse(selection.focusedArtboard.pluginData);
                //   pData.customProps = this.customProps;
                //   selection.focusedArtboard.pluginData = JSON.stringify(pData);
                // } else {
                //   selection.focusedArtboard.pluginData = JSON.stringify({
                //     customProps: this.customProps,
                //   });
                // }
            }
        });
    }

    async onRemoveProp(name, propToBindName) {
        this.onConfirm('warning', 'Warning', `Are you sure you would like to remove the "${name}" custom prop? Your action cannot be undone.`, 'Remove', confirm => {
            if (confirm) {
                editDocument(async (selection, rootNode) => {
                    if (selection.focusedArtboard) {
                        _utils.transferElementPluginDataToRoot(selection, rootNode);
                        // console.log('--------------- PANEL CONTROLLER - ON REMOVE PROP - APÓS TRANSFIR ---------------');
                        let indexToRemove;
                        Object.keys(this.customProps).forEach(index => {
                            if (this.customProps[index].name === name) {
                                indexToRemove = index;
                            }
                        });
                        this.customProps.splice(indexToRemove, 1);
                        let pData;
                        if (rootNode.pluginData && rootNode.pluginData !== '') {
                            pData = JSON.parse(rootNode.pluginData);
                            if (pData[selection.focusedArtboard.guid]) {
                                pData[selection.focusedArtboard.guid].customProps = this.customProps;
                            } else {
                                pData[selection.focusedArtboard.guid] = {
                                    customProps: this.customProps
                                };
                            }
                            rootNode.pluginData = JSON.stringify(pData);
                        } else {
                            pData = {};
                            if (pData[selection.focusedArtboard.guid]) {
                                pData[selection.focusedArtboard.guid].customProps = this.customProps;
                            } else {
                                pData[selection.focusedArtboard.guid] = {
                                    customProps: this.customProps
                                };
                            }
                            rootNode.pluginData = JSON.stringify(pData);
                        }
                        // let pData;
                        // if (selection.focusedArtboard.pluginData && selection.focusedArtboard.pluginData !== '') {
                        //   pData = JSON.parse(selection.focusedArtboard.pluginData);
                        //   pData.customProps = this.customProps;
                        // }
                        // selection.focusedArtboard.pluginData = JSON.stringify(pData);
                    }
                });
            }
            setTimeout(() => {
                this.onCustomProp(propToBindName);
            }, 600);
        });
    }

