    getNodeType(node) {
        let resp;
        if (node instanceof Rectangle) {
            resp = 'Rectangle';
        } else if (node instanceof Group) {
            if (node.pluginData && node.pluginData !== '' && JSON.parse(node.pluginData).type && JSON.parse(node.pluginData).type === 'Artboard') {
                resp = 'Artboard';
            } else {
                resp = 'Group';
            }
        } else if (node instanceof RepeatGrid) {
            resp = 'RepeatGrid';
        } else if (node instanceof SymbolInstance) {
            resp = 'SymbolInstance';
        } else if (node instanceof Text) {
            resp = 'Text';
            // } else if (node instanceof Artboard) {
            //   resp = 'Artboard'
        } else if (node instanceof Ellipse) {
            resp = 'Ellipse';
        } else if (node instanceof Path) {
            resp = 'Path';
        } else if (node instanceof BooleanGroup) {
            resp = 'BooleanGroup';
        } else if (node instanceof Polygon) {
            resp = 'Polygon';
        } else if (node instanceof Line) {
            resp = 'Line';
        }
        return resp;
    },
