    doExtract: async function (rootNode, selection, children, artboardChildren, layerOrderPath, childrenOrder, parent, assetsList, duplicated, edits, binds, commonFonts, usedFonts) {
        // console.log(
        //     '--------------- DO EXTRACT ---------------',
        //     children[0],
        //     children.length
        // )
        let assets = [];
        let childrenElems = [];
        await this.extract(rootNode, selection, children[0], artboardChildren, layerOrderPath, childrenOrder, parent, assetsList, duplicated, edits, binds, commonFonts, usedFonts).then(extractResp => {
            // children.push(extractResp)
            childrenElems.push(extractResp.element);
            assets = assets.concat(extractResp.assets);
            assetsList = assetsList.concat(assets);
            edits = Object.assign(edits, extractResp.edits);
            binds = Object.assign(binds, extractResp.binds);
            children.splice(0, 1);
        }).catch(error => {
            console.log(error);
            throw new Error(error);
        });
        if (children.length > 0) {
            await this.doExtract(rootNode, selection, children, artboardChildren, layerOrderPath, childrenOrder, parent, assetsList, duplicated, edits, binds, commonFonts, usedFonts).then(extractedChildren => {
                childrenElems = childrenElems.concat(extractedChildren.elements);
                assets = assets.concat(extractedChildren.assets);
                edits = Object.assign(edits, extractedChildren.edits);
                binds = Object.assign(binds, extractedChildren.binds);
            }).catch(error => {
                console.log(error);
                throw new Error(error);
            });
        }

        return {
            elements: childrenElems,
            assets: assets,
            edits: edits,
            binds: binds
        };
    },
