    getUsedFonts(elem, commonFonts) {
        let fonts = [];

        if (elem instanceof Text) {
            let nova = true;
            let instanceName = `${_utils.stripChar(_utils.getCleanName(elem.fontFamily)).toLowerCase()}_${_utils.stripChar(_utils.getCleanName(elem.fontStyle)).toLowerCase()}`;

            Object.keys(fonts).forEach(index => {
                if (fonts[index].instanceName === instanceName) {
                    nova = false;
                }
            });

            if (nova) {
                let unusual = true;
                Object.keys(commonFonts).forEach(index => {
                    if (commonFonts[index] === elem.fontFamily) {
                        unusual = false;
                    }
                });
                if (unusual) {
                    fonts.push({
                        name: elem.fontFamily,
                        style: elem.fontStyle,
                        instanceName: instanceName,
                        fileName: '',
                        path: '',
                        file: null
                    });
                }
            }

            if (elem.styleRanges && elem.styleRanges.length > 0) {
                Object.keys(elem.styleRanges).forEach(index => {
                    let nova = true;
                    let instanceName = `${_utils.stripChar(_utils.getCleanName(elem.styleRanges[index].fontFamily)).toLowerCase()}_${_utils.stripChar(_utils.getCleanName(elem.styleRanges[index].fontStyle)).toLowerCase()}`;

                    Object.keys(fonts).forEach(j => {
                        if (fonts[j].name === instanceName) {
                            nova = false;
                        }
                    });

                    if (nova) {
                        let unusual = true;
                        Object.keys(commonFonts).forEach(m => {
                            if (commonFonts[m] === elem.styleRanges[index].fontFamily) {
                                unusual = false;
                            }
                        });
                        if (unusual) {
                            fonts.push({
                                name: elem.styleRanges[index].fontFamily,
                                style: elem.styleRanges[index].fontStyle,
                                instanceName: instanceName,
                                fileName: '',
                                path: '',
                                file: null
                            });
                        }
                    }
                });
            }
        } else if (elem.children && elem.children.length > 0) {
            elem.children.forEach(child => {
                let nFonts = this.getUsedFonts(child, commonFonts);
                Object.keys(nFonts).forEach(index => {
                    let nova = true;
                    Object.keys(fonts).forEach(j => {
                        if (nFonts[index].instanceName === fonts[j].instanceName) {
                            nova = false;
                        }
                    });
                    if (nova) {
                        fonts.push(nFonts[index]);
                    }
                });
            });
        }

        return fonts;
    },
