    getElementInstanceName(elementGuid, artboardChildren, elem) {
        let instanceName;
        if (elem.guid === elementGuid) {
            let elementName = this.getElementName(elem);

            instanceName = this.stripChar(this.getCleanName(elementName));

            let renamed = false;

            // let elemParentType = this.getElementType(elem.parent)
            // // Renomeia: 1. Se o elem não for filho direto de um RepeatGrid; 2. E o child não for
            // // o próprio elem; 3. E existir algum child que já possua o instanceName do elem
            // // dentro do mesmo parent
            if (
            // elem.parent &&
            // elemParentType &&
            // elemParentType.toLowerCase() !== 'repeatgrid'
            elem.parent) {
                elem.parent.children.forEach(child => {
                    if (elem.guid !== child.guid && artboardChildren[child.guid] && artboardChildren[child.guid].instanceName && artboardChildren[child.guid].instanceName === instanceName) {
                        instanceName = `${instanceName}${this.guidSmall()}`;
                        renamed = true;
                    }
                });
            }

            // Renomeia: 1. Se não for descendente de um RepeatGrid; 2. E o elem tiver filhos;
            // 3. E o elem não seja o elemento selecionado no artboardChildren 4. E já existir
            // algum elemento no artboardChildren que possua o instanceName do elem
            if (!renamed) {
                Object.keys(artboardChildren).forEach(index => {
                    if (
                    // !this.childOfElementWithType('RepeatGrid', elem) &&
                    elem.children && elem.children.length > 0 && elem.guid !== index && artboardChildren[index] && artboardChildren[index].instanceName && artboardChildren[index].instanceName === instanceName) {
                        instanceName = `${instanceName}${this.guidSmall()}`;
                    }
                });
            }
        }
        if (!instanceName) {
            elem.children.forEach(child => {
                let childInstanceName = this.getElementInstanceName(elementGuid, artboardChildren, child);
                if (childInstanceName) {
                    instanceName = childInstanceName;
                }
            });
        }
        return instanceName;
    },
    fillAllElemPaths(elem, artboardChildren, elemPath, layerOrderPath, layerOrder) {
        // ANCHOR fillAllElemPaths
        // NOTE all elements must be previous written on document root pluginData
        if (!layerOrder) {
            layerOrder = 0;
        }
        if (layerOrderPath && layerOrderPath !== '') {
            layerOrderPath = `${layerOrderPath}-${layerOrder}`;
        } else {
            layerOrderPath = `${layerOrder}`;
        }
        if (elemPath && elemPath !== '') {
            elemPath = `${elemPath}::${artboardChildren[elem.guid].instanceName}`;
        } else {
            elemPath = `${artboardChildren[elem.guid].instanceName}`;
        }
        let elementName = this.getElementName(elem);
        // console.log(
        //     '--------------- LAYER ORDER ---------------',
        //     ' | ',
        //     elementName,
        //     ' | ',
        //     layerOrderPath,
        //     ' | ',
        //     layerOrder
        // )
        let originalInstanceName = this.stripChar(this.getCleanName(elementName));
        artboardChildren[elem.guid].originalInstanceName = originalInstanceName;
        artboardChildren[elem.guid].originalName = elementName;
        artboardChildren[elem.guid].elemPath = elemPath;
        artboardChildren[elem.guid].layerOrderPath = layerOrderPath;
        // artboardChildren[elem.guid].sign = this.getElementSign(elem)
        if (elem.children) {
            let layerOrderChild = 0;
            // if (
            //     elem instanceof RepeatGrid &&
            //     (!elem.children.at(0).name || elem.children.at(0).name === '')
            // ) {
            if (
            // elem instanceof RepeatGrid &&
            // elem.children.at(0).children.length === 1 &&
            // !(elem.children.at(0).children.at(0) instanceof Group)
            elem instanceof RepeatGrid && elem.children.at(0).children.length === 1) {
                elem.children.forEach(child => {
                    artboardChildren = this.fillAllElemPaths(child.children.at(0), artboardChildren, elemPath, layerOrderPath, layerOrderChild);
                    layerOrderChild++;
                });
            } else {
                elem.children.forEach(child => {
                    artboardChildren = this.fillAllElemPaths(child, artboardChildren, elemPath, layerOrderPath, layerOrderChild);
                    layerOrderChild++;
                });
            }
        }
        return artboardChildren;
    },
    childOfElementWithType(type, child) {
        let resp = false;
        if (child.parent) {
            let parentType = this.getElementType(child.parent);
            if (parentType && parentType.toLowerCase() === type.toLowerCase()) {
                resp = true;
            }
        }
        if (resp === false && child.parent) {
            resp = this.childOfElementWithType(type, child.parent);
        }
        // console.log('--------------- resp ---------------', resp);
        return resp;
    },
    getElementName(elem) {
        let elementName;
        let guidName = this.guid();
        if (!elem.name || elem.name && elem.name === '') {
            elementName = `No named element ${guidName}`;
            if (elem.parent && elem.parent.name && elem.parent.name !== '') {
                elementName = `${elem.parent.name}-${guidName}`;
            }
        } else {
            elementName = elem.name;
        }
        return elementName;
    },
