        const widthProp = component.props.width;
        const heightProp = component.props.height;
        const widthPercentProp = component.props.widthPercent;
        const heightPercentProp = component.props.heightPercent;
        const leftProp = component.props.left;
        const topProp = component.props.top;
        const rightProp = component.props.right;
        const bottomProp = component.props.bottom;
