    childrenPosition(children, parent) {
        const childrenX = children.boundsInParent.x - parent.localBounds.x;
        const childrenY = children.boundsInParent.y - parent.localBounds.y;
        let childrenRight = parent.globalBounds.width - (childrenX + children.globalBounds.width);
        let childrenBottom = parent.globalBounds.height - (childrenY + children.globalBounds.height);
        let childrenHGapCenter = parent.globalBounds.width / 2 - (childrenX + children.globalBounds.width / 2);
        let childrenVGapCenter = parent.globalBounds.height / 2 - (childrenY + children.globalBounds.height / 2);

        if (childrenRight < 0) {
            childrenRight *= -1;
        }
        if (childrenBottom < 0) {
            childrenBottom *= -1;
        }

        if (childrenHGapCenter > 0 && childrenHGapCenter < 1) {
            childrenHGapCenter = 0;
        }
        if (childrenHGapCenter < 0 && childrenHGapCenter > -1) {
            childrenHGapCenter = 0;
        }
        if (childrenVGapCenter > 0 && childrenVGapCenter < 1) {
            childrenVGapCenter = 0;
        }
        if (childrenVGapCenter < 0 && childrenVGapCenter > -1) {
            childrenVGapCenter = 0;
        }
        // console.log('--------------- CHIL POS ---------------', children, parent, children.globalBounds.width, parent.globalBounds.width, childrenX, childrenY, childrenHGapCenter, childrenVGapCenter);

        return {
            left: childrenX,
            top: childrenY,
            right: childrenRight,
            bottom: childrenBottom,
            hGapCenter: childrenHGapCenter,
            vGapCenter: childrenVGapCenter
        };
    },
